/*************************************************
 *
 * @exports
 * @class Footer.js
 * @extends Component
 * @author Ramkumar
 * @copyright © 2019 . All rights reserved.
 *************************************************/

import React, { Component } from "react";
import { connect } from "react-redux";
import { changeUploadStaus } from "../../actions/userAction";

class Footer extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isUploading: false
    };
  }

  render() {
    return (
      <footer class="footer">
        <div class="container">
          <div class="row">
            <div class="col-md-3">
              <div class="footer-left">
                <div class="flogo bold text-uppercase">harasow</div>
                <p class="para white">&copy; Harasow. All Rights Reserved.</p>
              </div>
            </div>
            <div class="col-md-9">
              <div class="row">
                <div class="col-md-3">
                  <ul class="flinks">
                    <li>Harasow</li>
                    <li>
                      <a href="javascript:;">Buy</a>
                    </li>
                    <li>
                      <a href="javascript:;">Sell / Trade</a>
                    </li>
                    <li>
                      <a href="javascript:;">Finance</a>
                    </li>
                  </ul>
                </div>
                <div class="col-md-3">
                  <ul class="flinks">
                    <li>About</li>
                    <li>
                      <a href="javascript:;">About Us</a>
                    </li>
                    <li>
                      <a href="javascript:;">Harasow Production</a>
                    </li>
                    <li>
                      <a href="javascript:;">FAQ</a>
                    </li>
                  </ul>
                </div>
                <div class="col-md-3">
                  <ul class="flinks">
                    <li>Contact</li>
                    <li>
                      <a href="javascript:;">(XXX) XXX - XXXX</a>
                    </li>
                    <li>
                      <a href="javascript:;">Contact Us</a>
                    </li>
                  </ul>
                </div>
                <div class="col-md-3">
                  <ul class="flinks">
                    <li>Company</li>
                    <li>
                      <a href="javascript:;">Terms of Use</a>
                    </li>
                    <li>
                      <a href="javascript:;">Privacy Policy</a>
                    </li>
                  </ul>
                </div>
              </div>
            </div>
          </div>
        </div>
      </footer>
    );
  }
}

const mapStateToProps = state => {
  return {};
};
const mapDispatchToProps = dispatch => {
  return {
    changeUploadStaus: value => {
      dispatch(changeUploadStaus(value));
    }
  };
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Footer);
